import "./styles.css";
import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import Home from "./pages/Home";
import Login from "./pages/Login"; 
import ApiDocs from "./pages/ApiDocs";
import Dashboard from "./pages/Dashboard";
import Payment from "./pages/Payment";
import TestApi from "./pages/TestApi";
import Profile from "./pages/Profile";
import ResetPassword from "./pages/ResetPassword";
import Contact from "./pages/Contact";

import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";

// Layout wrapper for pages that need Navbar + Sidebar
const LayoutWrapper = ({ children }) => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);
  const toggleSidebar = () => setIsSidebarOpen(prev => !prev);



  return (
    <>
      <Navbar toggleSidebar={toggleSidebar} />
      <Sidebar isOpen={isSidebarOpen} toggleSidebar={toggleSidebar} />

      <div style={{ padding: "1rem", marginLeft: isSidebarOpen ? "240px" : "0" }}>
        {children}
      </div>
    </>
  );
};

// Custom component to conditionally wrap pages with sidebar
const ConditionalLayout = ({ element, enableSidebar }) => {
  return enableSidebar ? <LayoutWrapper>{element}</LayoutWrapper> : element;
};

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<ConditionalLayout element={<Home />} enableSidebar={false} />} />
        <Route path="/login" element={<ConditionalLayout element={<Login />} enableSidebar={false} />} />
        <Route path="/signup" element={<ConditionalLayout element={<Login />} enableSidebar={false} />} />
        <Route path="/reset-password" element={<ConditionalLayout element={<ResetPassword />} enableSidebar={false} />} />
        <Route path="/payment" element={<ConditionalLayout element={<Payment />} enableSidebar={false} />} />
        <Route path="/contact" element={<ConditionalLayout element={<Contact />} enableSidebar={false} />} />

        {/* Pages with sidebar */}
        <Route path="/profile" element={<ConditionalLayout element={<Profile />} enableSidebar={true} />} />
        <Route path="/testapi" element={<ConditionalLayout element={<TestApi />} enableSidebar={true} />} />
        <Route path="/dashboard" element={<ConditionalLayout element={<Dashboard />} enableSidebar={true} />} />
        <Route path="/documentation" element={<ConditionalLayout element={<ApiDocs />} enableSidebar={true} />} />
      </Routes>
    </Router>
  );
}

export default App;
